'use strict';

const Fs = require('fs');

function readNodeExtraCACerts() {
    const location = process.env.NODE_EXTRA_CA_CERTS;
    if (location) {
        try {
            return Fs.readFileSync(location).toString();
        }
        catch (err) {
            console.error(`Failed to read NODE_EXTRA_CA_CERTS=${location}`, err.stack);
        }
    }
    return '';
}

